import (
	context "context"
	rapiddocs "github.com/single-url-environment-no-default/rapiddocs"
	rapiddocsclient "github.com/single-url-environment-no-default/rapiddocs/client"
	option "github.com/single-url-environment-no-default/rapiddocs/option"
)

client := rapiddocsclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
	option.WithBaseURL(
		rapiddocs.Environments.Production,
	),
)
response, err := client.Dummy.GetDummy(
	context.TODO(),
)
